var Core = require("leanft.sdk.core");
var SAPUI5BaseDesc = require("./sapui5_base.js").SAPUI5BaseDesc;
var SAPUI5BaseTestObject = require("./sapui5_base.js").SAPUI5BaseTestObject;
var HelperBehaviors = require("./helper_behaviors.js");

/**
 * The description of an SAPUI5 Tile test object.
 * @param {Object} [props] Initializes a Tile test object using the supplied property bag.
 * @returns {Tile} the description object that was initialized.
 * @constructor
 * @memberof SAPUI5
 * @extends SAPUI5.SAPUI5BaseDesc
 * @mixes SAPUI5.EnabledDescriptionBehavior
 */
function Tile(props) {
    var tileDes = new SAPUI5BaseDesc("Tile");

    Core.ObjectUtils.extend(tileDes, HelperBehaviors.EnabledDescriptionBehavior);

    tileDes._defineByPropertyBag(props);

    return tileDes;
}

/**
 * An SAPUI5 Tile.
 * @constructor
 * @memberof SAPUI5
 * @class TileTO
 * @extends SAPUI5.SAPUI5BaseTestObject
 * @mixes SAPUI5.EnabledTOBehavior._properties
 * @mixes WaitUntilEnabledBehavior._methods
 */
function TileTO(session, description) {
    description = description || Tile();
    var tileTO = new SAPUI5BaseTestObject("SAPUITile", session, description);

    tileTO._mergeBehavior(HelperBehaviors.EnabledTOBehavior);

    return tileTO;
}

module.exports.Tile = Tile;
module.exports.TileTO = TileTO;